import s from './UsersProfile.module.css';


export const UserProfile = ({user}) => {

    return (
        <div className={s.userProfile}>
        <div className={s.userPhoto}>
          <img src={user.avatar_url} alt="User Photo" />
          <h3>{user.name}</h3>
          <p>{user.bio}</p>
          <div> 

            <p>followers{user.followers}</p>
            <p>{user.following}</p>
          </div>
        </div>
